using Microsoft.AspNetCore.Identity;
using Microsoft.EntityFrameworkCore;
using Petbook.Data;

namespace Petbook.Models
{
    public static class SeedData
    {
        public static void Initialize(IServiceProvider serviceProvider)
        {
            using (var context = new ApplicationDbContext(
                serviceProvider.GetRequiredService
                <DbContextOptions<ApplicationDbContext>>()))
            {
                // check if in the db exists at least one role and that means
                // that this code was run before so we stop the execution
                // in order not to insert them again
                if (context.Roles.Any())
                {
                    return; // the db has already the roles inserted
                }

                // create and insert the roles in the db
                context.Roles.AddRange(
                    new IdentityRole { Id = "2c5e174e-3b0e-446f-86af-483d56fd7210", Name = "Admin", NormalizedName = "Admin".ToUpper() },
                    new IdentityRole { Id = "2c5e174e-3b0e-446f-86af-483d56fd7212", Name = "User", NormalizedName = "User".ToUpper() }
                );

                // instance used for creating the users passwords
                var hasher = new PasswordHasher<ApplicationUser>();

                // create and insert the users in the db
                context.Users.AddRange(
                    new ApplicationUser
                    {
                        Id = "8e445865-a24d-4543-a6c6-9443d048cdb0", // primary key
                        UserName = "Admin",
                        EmailConfirmed = true,
                        NormalizedEmail = "ADMIN@TEST.COM",
                        Email = "admin@test.com",
                        NormalizedUserName = "ADMIN@TEST.COM",
                        PasswordHash = hasher.HashPassword(null, "Admin1!"),
                        JoinDate = DateTime.Now.AddDays(-100),
                        ProfilePhoto = "data:image/png;base64,",
                        PhoneNumber = "0712312310",
                    },
                    new ApplicationUser
                    {
                        Id = "8e445865-a24d-4543-a6c6-9443d048cdb2", // primary key
                        UserName = "User",
                        EmailConfirmed = true,
                        NormalizedEmail = "USER@TEST.COM",
                        Email = "user@test.com",
                        NormalizedUserName = "USER@TEST.COM",
                        PasswordHash = hasher.HashPassword(null, "User1!"),
                        JoinDate = DateTime.Now.AddDays(-100),
                        ProfilePhoto = "data:image/png;base64,",
                        PhoneNumber = "0712312310",
                    }
                );

                // user-role association
                context.UserRoles.AddRange(
                    new IdentityUserRole<string>
                    {
                        RoleId = "2c5e174e-3b0e-446f-86af-483d56fd7210", // admin
                        UserId = "8e445865-a24d-4543-a6c6-9443d048cdb0"
                    },
                    new IdentityUserRole<string>
                    {
                        RoleId = "2c5e174e-3b0e-446f-86af-483d56fd7212",  // user
                        UserId = "8e445865-a24d-4543-a6c6-9443d048cdb2"
                    }
                );
                

                // create and insert 5 ApplicationUsers in the db with the User role
                string[] names = { "John", "Mary", "Peter", "Susan", "George" };
                for (int i = 0; i < 5; i++)
                {   
                    string id = Guid.NewGuid().ToString();
                    context.Users.Add(
                        new ApplicationUser
                        {
                            Id = id,
                            UserName = names[i],
                            EmailConfirmed = true,
                            JoinDate = DateTime.Now.AddDays(-i),
                            ProfilePhoto = "data:image/png;base64,",
                            PhoneNumber = "071231231" + i,
                            NormalizedEmail = "USER@TEST.COM",
                            Email = names[i].ToLower() + "@test.com",
                            NormalizedUserName = names[i].ToUpper() + "@TEST.COM",
                            PasswordHash = hasher.HashPassword(null, "User1!")
                        }
                    );
                    context.UserRoles.Add(
                        new IdentityUserRole<string>
                        {
                            RoleId = "2c5e174e-3b0e-446f-86af-483d56fd7210", // user role
                            UserId = id
                        }
                    );
                }
                context.SaveChanges();

                // create and insert 4 Pets for each user in the db
                foreach (var user in context.Users)
                {
                    for (int i = 0; i < 4; i++)
                    {
                        context.Pets.Add(
                            new Pet
                            {
                                PetName = "Pet " + i,
                                Category = "Dog",
                                Description = "This is a description",
                                Location = "This is a location",
                                UserId = user.Id,
                                PetPhoto= "data:image/png;base64,"
                            }
                        );
                    }
                }
                context.SaveChanges();

                // create and insert 4 Posts for each pet in the db
                string[] photos = {
                      "data:image/jpeg;base64,",
                      "data:image/jpeg;base64,",
                      "data:image/webp;base64,",
                      "data:image/jpeg;base64,",
                };
                foreach (var pet in context.Pets) {   
                    for (int i = 0; i < 4; i++)
                    {
                        context.Posts.Add(
                            new Post
                            {   
                                PostPhoto = photos[i],
                                Description = "This is a description " + i,
                                PostDate = DateTime.Now,
                                PetId = pet.PetId
                            }
                        );
                    }
                }

                //create and insert one blog post for each user in the db
               
                foreach (var user in context.Users)
                {
                    int indx = 0;
                    context.BlogPosts.Add(
                        new BlogPost
                        {
                            BlogPostTitle = "Blog post " + indx++,
                            BlogPostContent = "This is a new blog post belonging to " + user.UserName,
                            UserId = user.Id
                        }
                    
                    );
                }

                //add some tags
                context.Tags.Add(
                        new Tag
                        {
                            TagName = "#fluffypets"
                        }

                    );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#cats"
                     }
                 );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#dogs"
                     }
                 );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#hamster"
                     }
                 );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#unusualpets"
                     }
                 );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#mypet"
                     }
                 );

                context.Tags.Add(
                     new Tag
                     {
                         TagName = "#parrots"
                     }
                 );

                context.SaveChanges();
            }
        }
    }
}